      SELECT ALL + col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + + col2 * + col2 + + col1 BETWEEN - 88 + + ( col1 ) AND + col1 + - + 71;
  - name: tab2

outputs:
